import {connect} from 'react-redux'
import Login from '../Components/LogIn'
import {login} from '../redux/actions/login'

const mapStateToProps = (user) => {
  return {
    user: (lo) => dispatch(login(user))
  }
}

export default connect(mapStateToProps)(Login)
